'''
insertion sort
'''

def swap(a, i, j):
    a[i], a[j]=a[j],a[i]

def sort(a):
    '''returns # of swaps performed to sort a by insertion'''
    c=0
    for i in range(1,len(a)):
        key=a[i]
        for j in range (i-1,-1,-1):
            if a[j]>key:
                swap(a,j+1,j)
                c+=1
            else:
                break
    print(a)
    return c

